import React from 'react';
import Logo from '../img/logoHenry.png';

export default function Footer(){
    return (
        <nav className="navbar fixed-bottom navbar-light bg-light text-center text-decoration-none">
            <div  className='text-center'>
            <small className='text-center'>Made by <a className="text-decoration-none" href="http://www.github.com/florenRamirez"> Floren </a> for 
                <img src={Logo} width="20" height="20" alt=""/> 
                <a className="text-decoration-none" href="http://www.soyhenry.com"> Henry </a> 
            </small>
            </div>
            
        </nav>
    )
}
